import './App.css';
import { Container, Row, Col } from 'react-bootstrap';

export default function App(){
    return(

        <div className='App'>
            <Container className='h-100'>
                <Row className='h-100'>
                    <Col className='align-seleft-center'></Col>
                </Row>
            </Container>
        </div>
    );
}
